```json
{
  "application": "PBS",
  "details": {
    "resource_requirements": {
      "nodes": 1,
      "cpus": 4
    },
    "job_name": "stemness_brca",
    "queue": "ct160",
    "project": "ACD110174",
    "array_size": 10,
    "error_handling": "continue on error",
    "email": "r08942073@ntu.edu.tw",
    "email_events": "begin and end"
  },
  "other_software": {
    "modules": "purge all modules",
    "scripts": {
      "stemness.sh": "executed with BioMarkers[${PBS_ARRAY_INDEX}] and 'TCGA-BRCA' as arguments"
    },
    "data": {
      "BioMarkers": ["ERBB2", "ESR1", "MKI67", "PGR", "PLAU"]
    }
  }
}
```

**Explanation:**

* **application:** This script is run by PBS (Portable Batch System), a workload manager. 
* **resource_requirements:** The script requests one node with four CPUs.
* **job_name:** The job is named "stemness_brca".
* **queue:** The job is submitted to the "ct160" queue.
* **project:** The job is associated with project "ACD110174".
* **array_size:** The job is an array job with 10 tasks (1-10).
* **error_handling:** The job will continue even if a task fails.
* **email:** The user will receive email notifications at the beginning and end of the job.
* **modules:** The script clears all loaded modules before execution.
* **scripts:** The script executes the "stemness.sh" script with arguments.
* **data:**  The BioMarkers array is defined with several biomarker names.
